texte:
@AminMbarki Vaccin à vecteur viral comme Janssen est réservé uniquement au plus de 50 ans.
Le vaccin ARNm est interdit aux femmes enceintes en dessous du 1er trim ou souhaitant l'être dans les prochains semaines ou mois (aux hommes aussi). 
L'utilisation ARNm est pour les thérapies géniques

@Marco26245962 @Lereporter10 @NekewoKnight @PingSonic @xGab83 @Mediavenir Il vous reste l'astra ou le Janssen et très bientot le sanofi.
Par ailleurs pour vous cerner j'ai une petite question : 
Etes-vous favorable aux progrès technique,scientifique &amp; médicaux comme la robotique &amp; tout ce qui touche a la technomédecine.
